import React from 'react';
import {Route, Link, Switch} from 'react-router-dom';
import './App.css';
import chefOnboarding from './ChefLogin';
import chefPosting from './ChefPostPage';
import styled from 'styled-components';

const Header = styled.div`
  display: flex;
  justify-content: center;
`;
const NavLinks = styled.p`
  margin: 2%;
`;
const Links = styled(Link)`
  text-decoration: none;
  font-size: 1.2rem;
  color: #edf9f3;
  font-weight: bold;
  border: 2px solid #edf9f3;
`;

function App() {
  return (
    <div className="App">
      <chefOnboarding />
      <Route>
        <div>
          <h1>Welcome to the Chef Portfolio!</h1>
        </div>
        <Header>
          <NavLinks>
            <Links to='/'>Home</Links>
          </NavLinks>
          <NavLinks>
            <Links to='/chefposts'>Chef Posts</Links>
          </NavLinks>
        </Header>
        <Switch>
         <Route exact path='/' component={chefOnboarding} />
         <Route exact path='/chefposts' component={chefPosting} />
        </Switch>
      </Route>
    </div>
  );
}

export default App;
